import "./App.css";

const Header = () => {
  return (
    <div className="header">
      <div className="Logo-Container">
        <img
          className="logo"
          src="https://i.pinimg.com/736x/34/0c/6a/340c6add7519212185a08d4205eb1965.jpg"
          alt="FoodDelivery"
        />
      </div>
      <div className="nav-Items">
        <ul>
          <li>Home</li>
          <li>About Us</li>
          <li>Contact Us</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

const resObj={}





const RestaurantCard = (props) => {
  const{resName,cuisines} = props;
  return (
    <div className="res-card">
      <img className="res-logo" src="https://t3.ftcdn.net/jpg/01/96/80/24/360_F_196802485_VQxk0qmyPGTq56rKYXGikVGApD3A7v5T.jpg" alt="res-logo"></img>
      <h3>{resName}</h3>
      <h4>{cuisines}</h4>
      <h4>Reviews - 4.3</h4>
      <h4>30 Minutes</h4>
    </div>
  );
};


const Body = () => {
  return (
    <div className="body">
      <div className="search"> Search</div>
      <div className="res-container">
        <RestaurantCard resName="Meghana Foods" cuisines="Biryani, Cuisnies, Asian"/>
        <RestaurantCard resName="KFC" cuisines="chicken, fastfood , burger"/>

      </div>
    </div>
  );
};


const AppLayout = () => {
  return (
    <div className="app">
      <Header />
      <Body />
    </div>
  );
};

export default AppLayout;
